import { React, useState, useEffect } from 'react';
import { NavLink } from 'react-router-dom';
import './Dashboard.css';
// import users from '../service/db.json'; 
import { getUsers } from '../service/getUser.js';
import { Table, TableBody, TableCell, TableHead, TableRow } from '@mui/material';

const Dashboard = () => {

    function deleteUser() {

    }

    const [users, setUsers] = useState(null);

    useEffect(() => {
        const doGetUsers = async () => {
        const result = await getUsers();
            setUsers(result);
            console.log(result);
        };

        doGetUsers();
    }, []);

    return (
        <div className="dashboard">
            <div className="container">
                <div className="page__header">
                    <h1>User Dashboard</h1>
                    <NavLink to="/add"><button className="btn">Add User</button></NavLink>
                    {console.log(users.data)}
                </div>
                <div>
                    <Table>
                        <TableHead>
                            <TableRow>
                                <TableCell>First Name</TableCell>
                                <TableCell>Last Name</TableCell>
                                <TableCell>Email</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {users.data.map((data) => (
                                <TableRow key={data.id}>
                                    <TableCell>{data.first_name}</TableCell>
                                    <TableCell>{data.last_name}</TableCell>
                                    <TableCell>{data.email}</TableCell>
                                    <TableCell><button className="btn --small" onClick={() => deleteUser()}>Delete</button></TableCell>
                                </TableRow>
                            ))}
                        </TableBody>
                    </Table>
                </div>
            </div>
        </div>
    );
}

export default Dashboard;
